import React from "react";

const Slider = (props) => {
  return (
    <div className="slider">
      <input
        type="range"
        id="detailLevel"
        min={1}
        max={20}
        value={8}
        onChange={props?.onChange}
      />
      <p>{"Detail level : " + this.props?.value}</p>
    </div>
  );
};
export default Slider;
